script: |
  super -f text -I q3184.spq | sort > q3184.out

inputs:
  - name: q3184.spq
    data: |
      SELECT ALL - col1 AS col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT - col1 IN ( - col0, CAST ( - col0 AS INTEGER ) * - + col1 / 36, + col2 );
  - name: tab1

outputs:
  - name: q3184.out
    data: |
      -14
      -47
      -5
